                    <h3>Why Choose Uifry?</h3>
                    <div className="iconandadv">
                        <h5><img src="assets/bell.png" /> Clever Notifications</h5>
                    </div>

                </div>



            </div>








        <div>Bye</div>




        </section>

    );
};




export default Advantages;
